    "text": "喬治盧卡斯因清新小品《美國風情畫》初試啼聲，人們建議他替下部片子《星際大戰》談個高薪，但他只要求保留續集所有權與周邊商品銷售權。20世紀福斯覺得這只是蠅頭小利，一口答應。\n\n2005年福布斯在線估計，喬治有生之年由《星際大戰》周邊獲得的收入接近200億美元。（低估了吧）",
