    "text": "@tzangms 不傳之祕是，去食譜中將它額外設定的Title選項清空就好，因為它雞婆想要讓用戶多點選擇。清空後就與Pocket送進單純的連結一樣，Instapaper自然會填入文章標題。（工程師謎之音：早知道學Pocket偷懶設定就好...）",
