    "id": 668442634340294657,
    "id_str": "668442634340294657",
    "text": "補充一個小技巧，原本電子書就是最適合練習速讀的工具，你要反向將字型調大一些，眼睛盯著頁面中央，不要跟著字句，因為所有字其實都在你的視線範圍內，相信你都看到了，緩慢翻頁即可，這就是速讀的基本功。慢慢的訓練眼腦合一，就愈看愈快，再逐步調字。",
