    "id_str": "668265995950133248",
    "text": "之前推爛番茄評價系統時，忘了提以書評為基礎的推薦服務，叫做 https://t.co/R5ek8i87so 蒐集出版刊物、部落格與自身的書評，超過70%好評才入推薦之列。過多太客氣、只推不評（偽善）的業配行銷可能是盲點。 https://t.co/mlklSmj67X",
