    "text": "《摩托車修理店的未來工作哲學》引言中就有一段很有趣的話：「工藝課自1990開始，變成了過時的東西，因為教育界人士準備讓學生變成『知識工人』」，用來解釋拍賣網上很多工具都是從學校流出來的。\n\n現在，應該要把樹莓派這類新的數位工具，搭配程式教學，重新丟回學校的工藝課才對。",
