    "text": "「一座懸浮在空中的城堡，住著一位國王與他的兩個兒子，兄弟倆為爭奪王位而水火不容。某日兩位王子跌落地面，都試圖找尋回去的道路，歷經險阻之後，在一隻大鳥的協助下，兩人冰釋前嫌。」\n\n《Creativity, Inc.》",
