    "text": "「一個30歲從事會計工作的男人，不喜歡自己的工作。母親送他一本他小時候創作的怪獸書，從那晚開始，只有他能看見的怪獸無時無刻跟著他，都是他不敢面對的恐懼。最後男人與這些怪獸成了朋友，學會克服自己的恐懼，怪獸也隨之消失了。」\n\n《Creativity, Inc.》",
