    "text": "順道查了一下，原來中國第一本翻譯科幻小說，是魯迅翻譯的《從地球到月球》（De la Terre à la Lune）（或譯月界旅行），被譽為科幻小說之父、法國作家 Jules Verne 的作品，魯迅是從日本井上勤的日譯本轉譯成中文的。",
