    "id_str": "662290705029591040",
    "text": "用多看慣常都是單本導出書摘批注到 Evernote，想用還得再拷貝出來，有一點不方便。今天突然發現多看 Kindle 的管理功能就有導出功能，按下後會把閱讀器上所有書摘存進一個目錄，USB連線複製出來即可，一本一個 HTML，處理起來簡單多了。",
